import React from "react";
import NavBar from "../components/Navbar";
import Product from "../components/Product";

const Cart = () => {
  return (
    <div className="cart">
      <NavBar />
      <div className="container">
        <Product />
      </div>
    </div>
  );
};

export default Cart;
